--Aufgabe 1

anzahl :: (Int, Int, Int) -> String -> Int
anzahl (j, m, t) bez = length (filterFacade (j, m, t) bez)

-- Aufgabe 2

umsatz :: (Int, Int, Int) -> String -> Float
umsatz date bez = sum (mapBuchungZuPreis (filterFacade date bez))

-- Aufgabe 3

gewinn :: (Int, Int, Int) -> String -> Float
gewinn (j, m, t) bez = umsatz (j, m, t) bez - einzelkosten (j, m, t) bez - gemeinkostenProBuchung (j, m) * fromIntegral (anzahl (j, m, t) bez)
  where
    einzelkosten date bez = sum (mapBuchungZuKosten (filterFacade date bez))
    gemeinkostenProBuchung (j, m) = sumGemeinkosten (j, m) / fromIntegral (anzahl (j, m, 0) "*")
      where
        sumGemeinkosten (jahr, mon) = filterSum (jahr, mon) pacht + filterSum (jahr, mon) loehne
          where
            filterSum (jahr, mon) liste = sum (map snd (filter (\((j, m), _) -> j == jahr && m == mon) liste))

-- Aufgabe 4

topAnzahl :: (Int, Int) -> (String, Int, Float)
topAnzahl (j, m) = (bez, wert, fromIntegral wert / fromIntegral gesamt)
  where
    (bez, wert) = topFlop True (j, m) anzahl
    gesamt = anzahl (j, m, 0) "*"

flopAnzahl :: (Int, Int) -> (String, Int, Float)
flopAnzahl (j, m) = (bez, wert, fromIntegral wert / fromIntegral gesamt)
  where
    (bez, wert) = topFlop False (j, m) anzahl
    gesamt = anzahl (j, m, 0) "*"

topUmsatz :: (Int, Int) -> (String, Float, Float)
topUmsatz (j, m) = (bez, wert, wert / gesamt)
  where
    (bez, wert) = topFlop True (j, m) umsatz
    gesamt = umsatz (j, m, 0) "*"

flopUmsatz :: (Int, Int) -> (String, Float, Float)
flopUmsatz (j, m) = (bez, wert, wert / gesamt)
  where
    (bez, wert) = topFlop False (j, m) umsatz
    gesamt = umsatz (j, m, 0) "*"

topGewinn :: (Int, Int) -> (String, Float, Float)
topGewinn (j, m) = (bez, wert, wert / gesamt)
  where
    (bez, wert) = topFlop True (j, m) gewinn
    gesamt = gewinn (j, m, 0) "*"

flopGewinn :: (Int, Int) -> (String, Float, Float)
flopGewinn (j, m) = (bez, wert, wert / gesamt)
  where
    (bez, wert) = topFlop False (j, m) gewinn
    gesamt = gewinn (j, m, 0) "*"

topFlop :: (Ord a) => Bool -> (Int, Int) -> ((Int, Int, Int) -> String -> a) -> (String, a)
topFlop topOderFlop (j, m) wertFkt = berechneExtremum topOderFlop (berechneWerte wertFkt (j, m) artikel)
  where
    berechneWerte wertFkt (j, m) = map (\(_, bez, _, _, _) -> (bez, wertFkt (j, m, 0) bez))
    berechneExtremum _ [] = error "Liste lehr"
    berechneExtremum minOderMax (x : xs) = foldl vergleiche x xs
      where
        vergleiche a b
          | minOderMax = if snd a > snd b then a else b
          | otherwise = if snd a < snd b then a else b

-- allgemeine Funktionen

-- Kombiniert alle Filterfunktionen und gibt die Buchungen zurück, die mit dem Filter übereinstimmen
filterFacade :: (Int, Int, Int) -> String -> [((Int, Int, Int), (Int, Int), Int)]
filterFacade (j, m, t) bez = filterBuchungenNachArtikel (filterArtikelAusString bez) (filterNachDatum (j, m, t))

-- Kombination der unterschiedlichen Datenfilter
filterNachDatum :: (Int, Int, Int) -> [((Int, Int, Int), (Int, Int), Int)]
filterNachDatum (j, m, t) = filterNachTag t (filterNachMonat m (filterNachJahr j buchungen))

filterNachJahr :: Int -> [((Int, Int, Int), (Int, Int), Int)] -> [((Int, Int, Int), (Int, Int), Int)]
filterNachJahr j = filter (\((jahrInBuchung, _, _), _, _) -> jahrInBuchung == j)

filterNachMonat :: Int -> [((Int, Int, Int), (Int, Int), Int)] -> [((Int, Int, Int), (Int, Int), Int)]
filterNachMonat m = filter (\((_, monatInBuchung, _), _, _) -> monatInBuchung == m)

filterNachTag :: Int -> [((Int, Int, Int), (Int, Int), Int)] -> [((Int, Int, Int), (Int, Int), Int)]
filterNachTag 0 liste = liste
filterNachTag t liste = filter (\((_, _, tagInBuchung), _, _) -> tagInBuchung == t) liste

-- Filtert alle Artikel mit passender Bezeichnung oder Kategorie bzw. '*'; Fehlermeldung bei keiner Übereinstimmung
filterArtikelAusString :: String -> [(Int, String, String, Float, Float)]
filterArtikelAusString "*" = artikel
filterArtikelAusString bezeichnung = if not (null filterFunktion) then filterFunktion else error "Artikel/Kategorie nicht gefunden. Sollen alle Artikel durchsucht werden '*' verwenden!"
  where
    filterFunktion = filter (\(_, bez, kat, _, _) -> bez == bezeichnung || kat == bezeichnung) artikel

-- Artikelliste wird übergeben und alle Buchungen aussortiert, die nicht übereinstimmen mit den übergebenen Artikeln
filterBuchungenNachArtikel :: [(Int, String, String, Float, Float)] -> [((Int, Int, Int), (Int, Int), Int)] -> [((Int, Int, Int), (Int, Int), Int)]
filterBuchungenNachArtikel [] liste = []
filterBuchungenNachArtikel ((artikelNr, _, _, _, _) : xs) liste = filter (\((_, _, _), _, nr) -> artikelNr == nr) liste ++ filterBuchungenNachArtikel xs liste

-- gibt für Buchungen die jeweiligen Preise zurück
mapBuchungZuPreis :: [((Int, Int, Int), (Int, Int), Int)] -> [Float]
mapBuchungZuPreis = map (preis . findeArtikel . artikelId)
  where
    preis (_, _, _, p, _) = p

-- gibt für Buchungen die jeweiligen Preise zurück
mapBuchungZuKosten :: [((Int, Int, Int), (Int, Int), Int)] -> [Float]
mapBuchungZuKosten = map (kosten . findeArtikel . artikelId)
  where
    kosten (_, _, _, _, k) = k

-- gibt aus einer Buchung die Artikel ID zurück
artikelId :: ((Int, Int, Int), (Int, Int), Int) -> Int
artikelId (_, _, id) = id

-- gibt den Artikel anhand der ID zurück
findeArtikel :: Int -> (Int, String, String, Float, Float)
findeArtikel id
  | length (gefiltert id) == 1 = head (gefiltert id)
  | null (gefiltert id) = error ("Artikel mit ID " ++ show id ++ " existiert nicht")
  | otherwise = error ("Artikel ID " ++ show id ++ " ist nicht eindeutig")
  where
    gefiltert artikelId = filter (\(id, _, _, _, _) -> id == artikelId) artikel
